        method: 'GET',
        'headers': 
        {
            'content-type':'application/json',
            'Authorization':'Bearer rppiBAzwlr8pRdqmNfZsacSUE6djbISbXStT'
        }
    }).then(res =>res.json())
    .then(data =>
        {
            if(data._meta.success){
                dispatch
                (   {
                        type: "FETCH_DATA",
                        payload: data.result
                    }
                )
            }
            console.log("data");
            console.log(data);
        })
}
